import React from "react";
import Sdata from "./Div";
import Card from "./App"
const n="amzone";

const NewS=()=>{
        if (n =="netflix") {
         return (
           <>
        <Card 
         key={Sdata[1].id}
         imgsrc={Sdata[1].imgscr}
         title={Sdata[1].title}
         sname={Sdata[1].sname}
         link={Sdata[1].link}/>;
         </>

)}
        else{
        return ( 
       <Card key={Sdata[2].id}
         imgsrc={Sdata[2].imgscr}
         title={Sdata[2].title}
         sname={Sdata[2].sname}
         link={Sdata[2].link}/>
    )

}

  } 




export default NewS;
